import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user') || '{}');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          Sistema de Gestión de Café
        </Typography>
        {user.id ? (
          <Box>
            <Button color="inherit" onClick={() => navigate('/empleados')}>
              Empleados
            </Button>
            <Button color="inherit" onClick={() => navigate('/fincas')}>
              Fincas
            </Button>
            <Button color="inherit" onClick={() => navigate('/asignaciones')}>
              Asignaciones
            </Button>
            <Button color="inherit" onClick={() => navigate('/pagos')}>
              Pagos
            </Button>
            <Button color="inherit" onClick={handleLogout}>
              Cerrar Sesión
            </Button>
          </Box>
        ) : (
          <Box>
            <Button color="inherit" onClick={() => navigate('/login')}>
              Iniciar Sesión
            </Button>
            <Button color="inherit" onClick={() => navigate('/register')}>
              Registrarse
            </Button>
          </Box>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
